// AuditLogList.js
import React, { useEffect, useState } from 'react';

import { fetchAuditLogs } from './api';

const AuditLogList = () => {
    const [logs, setLogs] = useState([]);

    useEffect(() => {
        const getLogs = async () => {
            const response = await fetchAuditLogs();
            setLogs(response.data);
        };
        getLogs();
    }, []);

    return (
        <div className="container mx-auto p-4">
            <h2 className="text-2xl font-bold mb-4">Audit Trail</h2>
            <table className="table-auto w-full">
                <thead>
                    <tr>
                        <th className="px-4 py-2">User</th>
                        <th className="px-4 py-2">Action</th>
                        <th className="px-4 py-2">Timestamp</th>
                        <th className="px-4 py-2">Document</th>
                        <th className="px-4 py-2">Meeting Minutes</th>
                        <th className="px-4 py-2">Resolution</th>
                        <th className="px-4 py-2">Voting Result</th>
                    </tr>
                </thead>
                <tbody>
                    {logs.map((log) => (
                        <tr key={log.id}>
                            <td className="border px-4 py-2">{log.user}</td>
                            <td className="border px-4 py-2">{log.action}</td>
                            <td className="border px-4 py-2">{new Date(log.timestamp).toLocaleString()}</td>
                            <td className="border px-4 py-2">{log.document_name}</td>
                            <td className="border px-4 py-2">{log.meeting_minutes}</td>
                            <td className="border px-4 py-2">{log.resolution}</td>
                            <td className="border px-4 py-2">{JSON.stringify(log.voting_result)}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default AuditLogList;
